def determine_game_outcome(n: int, s: str) -> str:
    if s[::-1] != s:
        if s.count('0') == 0:
            return 'DRAW'
        if n % 2 and s[n // 2] == '0' and (s.count('0') != 1):
            return 'ALICE'
        else:
            return 'BOB'
    s = list(s)
    diff = False
    flag = False
    for i in range(n):
        if s[i] != s[n - i - 1]:
            if diff:
                flag = True
                break
            diff = True
            s[i] = '1'
            s[n - i - 1] = '1'
    if flag or s.count('0') == 0:
        return 'ALICE'
    if n % 2 and s[n // 2] == '0' and (s.count('0') == 1):
        return 'DRAW'
    else:
        return 'ALICE'

